import React, { PureComponent } from 'react';
import {
  ComposedChart, Line, Area, Bar, XAxis, YAxis, CartesianGrid, Tooltip,
  Legend, Scatter,
} from 'recharts';

const data = [
  {
    name: '9/1', av: 590, lv: -800, pv: 1400,
  },
  {
    name: '9/8', av: 868, lv: -967, pv: 1506,
  },
  {
    name: '9/15', av: 1397, lv: -1098, pv: 989,
  },
  {
    name: '9/22', av: 1480, lv: -1200, pv: 1228,
  },
  {
    name: '9/29', av: 1520, lv: -1108, pv: 1100,
  },
  {
    name: '10/6', av: 1400, lv: -680, pv: 1700,
  },
];

export default class Example extends PureComponent {

  render() {
    return (
      <ComposedChart
        width={500}
        height={400}
        data={data}
        stackOffset="sign"
        margin={{
          top: 20, right: 20, bottom: 20, left: 20,
        }}
      >
        <CartesianGrid stroke="#f5f5f5" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Area name="% active users" type="monotone" dataKey="pv" fill="#00cc00" fillOpacity={1} />
        <Bar name="adds" dataKey="av" barSize={20} stackId="a" fill="#00A6CA" />
        <Bar name="losses" dataKey="lv" barSize={20} stackId="a" fill="#b30000" />
        {/* <Scatter dataKey="cnt" fill="red" /> */}
      </ComposedChart>
    );
  }
}
